function content(c, mapid) {
    //判断有没有装备钓鱼竿
    //var a = c.getInventory(MapleInventoryType.EQUIPPED).getItem( - 11);
    //if (a == null || a.getItemId() != 1432039) {
    //   return false;
    //}
    //var a = c.getInventory(MapleInventoryType.EQUIP).getItem(1);
	//判断钓鱼竿是否放在第一格
	var a = em.equiptory(1);
    if (a == null || a.getItemId() != 1432039) {
        c.dropMessage(-1, "请不要戴上钓鱼竿,请把钓鱼竿放在背包的第一格才可进行钓鱼.");
        return false;
    }
    if (getItemAmount(c, 2300000) || getItemAmount(c, 2300001)) {
        if (mapid != 910000000) { //比赛图.
            if (getItemAmount(c, 2300001)) {
                //高级鱼
                addItem(c, 1);
            } else {
                //普通鱼
                addItem(c, 0);
            }
        } else {
            gainItem(c, (getItemAmount(c, 2300001) == 0) ? 2300000 : 2300001, -1);
            c.dropMessage(-1, "可爱的小鱼儿挣扎了一番逃跑了.");
        }
        ChanceItemDrop(c); //一定几率获得其他物品
    } else {
        //c.getClient().getSession().write(Packages.tools.packet.CField.serverNotice(5, "鱼饵用光了."));
        c.getClient().getSession().write(Packages.tools.packet.CWvsContext.broadcastMsg(5, "你背包里的鱼饵用完了."));

    }
    return true;
}
//装备掉落
function ChanceItemDrop(player) {
    var itemid = Math.floor(Math.random() * fish.length);
    var randNum = Math.floor(Math.random() * 1000) + 1;//极品装备出现的概率,越大就越难钓
    var a = weapon_quality[Math.floor(Math.random() * weapon_quality.length)];
    var b = weapon[Math.floor(Math.random() * weapon.length)];
    if (randNum < em.player_Fishing_Chancebest()) {//钓带属性物品出现的几率
        gainItem_specail(player, a[0], 1, Math.floor((Math.random() * a[1])));
        player.dropMessage(-1, "你钓到了属性极品装备.");
        em.broadcastServerMsg(5121048, "[" + player.getName() + "]玩家在钓鱼场钓出了极品装备。", true);
        //em.gainGachaponItem(itemid, 3, "[钓鱼奖励]", 1, false, 0);

    } else if (randNum >= em.player_Fishing_Chancebest() && randNum <= em.player_Fishing_Chance()) {//不带属性物品
        gainItem_specail(player, b, 1, 0);
        player.dropMessage(-1, "你钓到了东西.");
        //em.broadcastServerMsg(5121036,"["+player.getName() + "]你钓到了东西。",true);

    }
    return true;
}

//获取物品数量.
function getItemAmount(player, itemid) {
    return player.getItemAmount(itemid);
}

function addItem(c, choose) { //增加鱼
    var randNum = Math.floor(Math.random() * 1000) + 1;
    var jf = 0;
    if (choose) { //高级鱼饵能钓到更多的鱼.
        randNum += 900;
    }
    if (fish.length > 0) {
        var itemid = Math.floor(Math.random() * fish.length);
        if (fish[itemid][1] > randNum) {
            c.dropMessage(-1, "消耗了一个鱼饵.但是没有钓到任何东西.");

            gainItem(c, (getItemAmount(c, 2300001) == 0) ? 2300000 : 2300001, -1);
            return;
        }
        c.dropMessage(-1, "消耗了一个鱼饵.但是没有钓到任何东西.");
    }
    gainItem(c, (getItemAmount(c, 2300001) == 0) ? 2300000 : 2300001, -1);
    //c.dropMessage(-1,"消耗了一个鱼饵.但是没有钓到任何东西."); 

    jf = c.getDyjf();
    c.setDyjf(++jf);//钓鱼积分
    c.dropMessage(-1, "您获得了钓鱼积分.当前钓鱼积分:\t [" + jf + "]积分.");
}

